import React from 'react'

export const ModalSelectUsers = () => {
    const loading = (
        <div key={0} className="ct-chat-user-item">
          <Spin indicator={<Icon type="loading" spin />} size="large" />
        </div>
      );
      const { contacts, onContactSelect, selectedContacts } = this.props;
  
    return <div> Modal Select Users!</div>
}
